import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { MDBListGroup, MDBListGroupItem, MDBInput,MDBBtn,Animation, MDBJumbotron, MDBContainer,MDBRow, MDBCol, MDBCard, MDBCardBody, MDBCardTitle, MDBCardText } from "mdbreact";
import '../Home.css';
import { connect } from 'react-redux';
import Hero from'../Pics/tab.jpg';
import LazyHero from 'react-lazy-hero';


class Food extends React.Component {
	constructor(props) {
    super(props);
  }

	componentDidMount(){
		this.props.dispatch({ type:"NAVLOCATION"});

	}

  componentWillUnmount(){
    window.scrollTo(0, 0)
  }

	render(){
		return(
			<div className="Home">
			<LazyHero color = "#000000" parallaxOffset="50" minHeight='100vh' opacity ="0.5" imageSrc={Hero} >
			 <MDBContainer className= "grid">
				 {/* 	Hier die trasnparente Box mit allem	*/}
				 <div className= "HeroText">
					 <MDBRow>
						 <MDBCol><h1> Hier findest du die Speisekarte:</h1></MDBCol>
					 </MDBRow>
				 </div>
			 </MDBContainer>
		 </LazyHero>

		 <MDBContainer>
		  <MDBListGroup>
		    <MDBListGroupItem href="#">Cras justo odio</MDBListGroupItem>
		    <MDBListGroupItem href="#">Dapibus ac facilisis in</MDBListGroupItem>
		    <MDBListGroupItem href="#">Morbi leo risus</MDBListGroupItem>
		    <MDBListGroupItem href="#">Porta ac consectetur ac</MDBListGroupItem>
		    <MDBListGroupItem href="#">Vestibulum at eros</MDBListGroupItem>
		  </MDBListGroup>
		</MDBContainer>
			</div>
		);
	}
}

export default connect()(Food);
